import React, { Component } from 'react';
import logo from './logo.svg';
import 'carbon-components/scss/globals/scss/styles.scss';


import { Breadcrumb, BreadcrumbItem, BreadcrumbSkeleton, DataTable } from 'carbon-components-react';

const rows = [
  {
    id: "a",
    foo: "Foo a",
    bar: "Bar a",
    baz: "Baz a"
  },
  {
    id: "b",
    foo: "Foo b",
    bar: "Bar b",
    baz: "Baz b"
  },
  {
    id: "c",
    foo: "Foo c",
    bar: "Bar c",
    baz: "Baz c"
  }
];

const headers = [
  {
    key: "foo",
    header: "Foo"
  },
  {
    key: "bar",
    header: "Bar"
  },
  {
    key: "baz",
    header: "Baz"
  }
];
const {
  Table,
  TableHead,
  TableHeader,
  TableBody,
  TableCell,
  TableContainer,
  TableRow,
  TableSelectAll,
  TableSelectRow
} = DataTable;

class App extends Component {
  render() {
    return (
      <div className="App">

        <Breadcrumb className="some-class" noTrailingSlash={false} onClick={() => console.log('clicked')}>
          <BreadcrumbItem>
            <a href="/#">
              Breadcrumb 1
          </a>
          </BreadcrumbItem>
          <BreadcrumbItem href="#">
            Breadcrumb 2
          </BreadcrumbItem>
          <BreadcrumbItem href="#">
            Breadcrumb 3
          </BreadcrumbItem>
        </Breadcrumb>

        <DataTable
          rows={rows}
          headers={headers}
          render={({
            rows,
            headers,
            getHeaderProps,
            getSelectionProps,
            selectedRows
          }) => (
              <TableContainer>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableSelectAll {...getSelectionProps()} />
                      {headers.map(header => (
                        <TableHeader {...getHeaderProps({ header })}>
                          {header.header}
                        </TableHeader>
                      ))}
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {rows.map(row => (
                      <TableRow key={row.id}>
                        <TableSelectRow {...getSelectionProps({ row })} />
                        {row.cells.map(cell => (
                          <TableCell key={cell.id}>{cell.value}</TableCell>
                        ))}
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>)} />

      </div>
    );
  }
}

export default App;
